const NRFlowSet = require("./NRFlowSet.js")

/**
 * parseFlow - Description
 *
 * @param {array} flowConfig An Flow JSON Array
 * @return {NRFlowSet} Description
 */
function parseFlow(flowConfig) {
    const flowSet = new NRFlowSet(flowConfig);
    return flowSet;
}

module.exports = {
    parseFlow: parseFlow
}
